// Header.js

import React from 'react';
import { Link } from 'react-router-dom';

function Header({ title, isLoggedIn }) {
  return (
    <header className="Header">
      <h1>{title}</h1>
      {isLoggedIn && (
        <nav className="Menu">
          <ul>
            <li>
              <Link to="/home">홈</Link>
            </li>
            <li>
              <Link to="/about">소개</Link>
            </li>
            <li>
              <Link to="/contact">연락</Link>
            </li>
          </ul>
        </nav>
      )}
    </header>
  );
}

export default Header;
